import React from "react";

function ProductsOfArtist() {
  let products = [1, 2, 3, 4, 5, 6, 7, 8, 9];

  // make set of 3

  let pArr = [];
  products.forEach((element, i) => {
    console.log(i);
    if (i % 3 === 0) pArr.push([element]);
    else pArr[pArr.length - 1].push(element);
  });
  console.log(pArr);

  return (
    <div className="container-xxl">
      <div className="row">
        <div className="col-md-12">
          <img
            src="https://i1.sndcdn.com/artworks-PZOnPSbRx5SlcIfY-QpdgbA-t500x500.jpg"
            alt=""
            srcset=""
          />
        </div>
      </div>
    </div>
  );
}

export default ProductsOfArtist;
